import React from "react";

const ExpenseDate = ({ date }) => {
  const day = date.getDate();
  const month = date.toLocaleString("pt-BR", { month: "long" });
  const year = date.getFullYear();
  return (
    <div>
      <div>{year}</div>
      <div>{day}</div>
      <div>{month}</div>
    </div>
  );
};

export default ExpenseDate;
